  const boton = document.getElementById("botonContinuar");
  const radios = document.querySelectorAll("input.emocion");
  const mensaje = document.getElementById("mensajeAviso");

  function verificarRespuestas() {
    let respuestas = new Set();
    radios.forEach(radio => {
      if (radio.checked) {
        respuestas.add(radio.name);
      }
    });

    if (respuestas.size === totalItems) {
      boton.disabled = false;
      mensaje.textContent = "";
    } else {
      boton.disabled = true;
      mensaje.textContent = `Debe responder las ${totalItems} filas de emociones antes de continuar.`;
    }
  }

  radios.forEach(r => r.addEventListener("change", verificarRespuestas));
